import React, { useState } from 'react';
import './TilePicker.css';

const possibleTiles = [
  // Add the possible tiles here
];

const TilePicker = () => {
  const [currentTile, setCurrentTile] = useState(null);

  const pickTile = () => {
    const randomIndex = Math.floor(Math.random() * possibleTiles.length);
    setCurrentTile(possibleTiles[randomIndex]);
  };

  return (
    <div className="tile-picker">
      <button onClick={pickTile}>Pick a Tile</button>
      {currentTile && <div className="tile">{currentTile}</div>}
    </div>
  );
};

export default TilePicker;
